CREATE TABLE `mountain` (
  `id` int(11) NOT NULL,
  `x` int(11) NOT NULL,
  `y` int(11) NOT NULL,
  `height` int(11) NOT NULL,
  `slope` int(11) NOT NULL,
  `range` int(11) NOT NULL,
  `volcano` tinyint(1) NOT NULL,
  `building` tinyint(4) NOT NULL,
  `note` text,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

